import img1 from '../src/image/digital.jpg';
import img2 from '../src/image/andriod.jpg';
import img3 from '../src/image/marketing.jpg';
import img4 from '../src/image/software.jpg';
import img5 from '../src/image/app.jpg';
import img6 from '../src/image/cloud.jpg';

const Carddta=[
    {
        imgsrc:img1,
        title:"Software development"
    },
    {
        imgsrc:img2,
        title:"Cloud Computing"
    },
    {
        imgsrc:img3,
        title:"App development"
    },
    {
        imgsrc:img4,
        title:"Marketing"
    },
    {
        imgsrc:img5,
        title:"Cloud"
    },
    {
        imgsrc:img6,
        title:"Andriod development"
    }
]
export default Carddta;
